SnippetCode.val:
using System;
using System.Diagnostics;

public static class Snippet
{
	public static System.String printPdf(System.String filenamePdf, System.String filenamePdfPriterExe, System.Double maxWaitTimeMs, System.Double exitCode)
	{
		Process p = null;
		string errormessage = "";

		try {

			// Start the process ...
			p = new Process();
			p.StartInfo.UseShellExecute = false;
			p.StartInfo.CreateNoWindow = false;
			p.StartInfo.FileName = filenamePdfPriterExe;
			p.StartInfo.Arguments = "/p " + filenamePdf;
			p.Start();

			int nMsWaited = 0;
			while (!p.WaitForExit(500)) {
				if (maxWaitTimeMs > 0) {
					nMsWaited *= 500;
					if (nMsWaited >= maxWaitTimeMs) {
						p.Kill();
					}
				}
			};

			exitCode = p.ExitCode;
			p.Close();

		} 
		catch (Exception e) {
			errormessage = e.Message;
		}
		finally {
			exitCode = p.ExitCode;
			if (p != null)
				p.Close();
		}

		return errormessage;
	}

}
